import axios from 'axios';
import { config } from '../utils/config';
import { toast } from 'react-toastify';

const storeConfigActions = {
  fetchStoreGroups: () => {
    return (dispatch) => {
      axios({
        url: `${config.createMarkdownURL}/get-storesgroups`,
        method: 'GET',
      })
        .then((resp) => {
          console.log(resp, 'storesgroups');
          dispatch({
            type: 'SET_STORE_GROUPS',
            payload: resp.data,
          });
        })
        .catch((err) => {
          console.log(err);
        });
    };
  },
  getStoreGroupTableData: (reqObj) => {
    return (dispatch) => {
      axios({
        url: `${config.createMarkdownURL}/get-stores`,
        method: 'GET',
        data: reqObj,
      })
        .then((resp) => {
          console.log(resp, 'get-stores');
          dispatch({
            type: 'SET_STORE_GROUP_TABLE_DATA',
            payload: resp.data,
          });
        })
        .catch((err) => {
          console.log(err);
        });
    };
  },
  createStoreGroup: (reqObj) => {
    return (dispatch) => {
      axios({
        url: `${config.createMarkdownURL}/get-stores-create`,
        method: 'POST',
        data: reqObj,
      })
        .then((resp) => {
          console.log(resp, 'get-stores-create');
        })
        .catch((err) => {
          console.log(err);
        });
    };
  },
};

export default storeConfigActions;
